import React from 'react';

const Players = () => {
    const hockeyPlayers = [
        { name: 'Connor McDavid', age: 24, shootHand: 'Left' },
        { name: 'Sidney Crosby', age: 33, shootHand: 'Left' },
        { name: 'Auston Matthews', age: 23, shootHand: 'Left' },
        { name: 'Alex Ovechkin', age: 35, shootHand: 'Right' },
        { name: 'Nathan MacKinnon', age: 25, shootHand: 'Right' },
    ];

    return (
        <div>
            <h1>Hockey Players</h1>
            <ul>
                {hockeyPlayers.map((player, index) => (
                    <li key={index}>
                        <p>Name: {player.name}</p>
                        <p>Age: {player.age}</p>
                        <p>Shoot Hand: {player.shootHand}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Players;
